House of Voices tells the chilling story of a woman who discovers the frightening secrets of an abandoned orphanage. Starring Virginie Ledoyen (The Beach), this film brings a terrifying new look at ghost stories, with a twist ending that is sure to shock you!House of Voices original title Saint Ange refers to an orphanage in the French Alps in the year 1958. The orphanage, once full of children, prepares for the final move out, after a mysterious and terrible accident where a child slipped and fell in the bathroom, which the audience bears witness to in the opening. The protagonist Anna (Virginie Ledoyen) arrives amidst the chaotic scurrying in and out of the large building, as she is the only one carrying stuff inside. It almost feels like the rats are abandoning the ship while Anna is the only one who decides to stay, which immediately suggests that something is not right with the situation.

